class Solution(object):
    # 不够快，没AC
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        length = len(s)
        if length % 2 == 0:
            # 这个比较特殊
            if s[:(length//2)] == s[(length//2):][::-1]:
                return s
            # 下面的情况奇数偶数差不多，就是开始的index不太一样，抓住回文有两种情况就好了
            else:
                for i in xrange((length//2-1),-1,-1):
                    if s[:i] == s[i+1:2*i+1][::-1]:
                        #return s[i:][::-1][:-1] + s[i:]
                        return s[2*i+1:][::-1] + s
                    if s[:i] == s[i:2*i][::-1]:
                        #return s[i:][::-1] + s[i:]
                        return s[2*i:][::-1] + s
        else:
            for i in xrange(length//2,-1,-1):
                if s[:i] == s[i+1:2*i+1][::-1]:
                    #return s[i:][::-1][:-1] + s[i:]
                    return s[2*i+1:][::-1] + s
                if s[:i] == s[i:2*i][::-1]:
                    #return s[i:][::-1] + s[i:]
                    return s[2*i:][::-1] + s

s = Solution()
test = ""
result = ""
final = s.shortestPalindrome(test)